import React from 'react';
import Carousel from 'better-react-carousel';
import foodCards from "./Cards";


const FoodGallery = () => {
  return (
    <Carousel cols={5} rows={1} gap={10} loop>
      {cards.map((card, index) => (
        <Carousel.Item>
          <div key={index}>
          <h5>{card.title}</h5>
          <img alt={card.title} src={card.imageSrc} width="368" height="276" />
          </div>
        </Carousel.Item>
        ))}
    </Carousel>
  )
};

const CocktailGallery = () => {
    return (
      <Carousel cols={5} rows={1} gap={10} loop>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/smokyMezcal.jpeg" alt="Smoky Mezcal pic" />
        </Carousel.Item>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/brooklyn.jpeg" alt="The Brooklyn pic" />
        </Carousel.Item>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/blackberry.jpeg" alt="Blackberry Cocktail pic" />
        </Carousel.Item>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/negroni.jpeg" alt="Negroni pic" />
        </Carousel.Item>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/hawaii.jpeg" alt="Hawaii cocktail pic" />
        </Carousel.Item>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/oldfashioned.jpeg" alt="Old Fashioned pic" />
        </Carousel.Item>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/cucumber.jpeg" alt="Cucumber Cooler pic" />
        </Carousel.Item>
        <Carousel.Item>
          <img width="100%" src="../images/cocktails/grandtavern.jpeg" alt="grand tavern pic" />
        </Carousel.Item>
      </Carousel>
    )
  }


export default FoodGallery;
export { CocktailGallery };
